import React from 'react';
import { motion } from 'framer-motion';
import { useInView } from 'react-intersection-observer';
import { Music, Headphones, Cpu, Palette } from 'lucide-react';

const About = () => {
  const [ref, inView] = useInView({
    triggerOnce: true,
    threshold: 0.1,
  });

  const skills = [
    { name: "Ableton Live", icon: <Music className="w-6 h-6" />, color: "text-cyber-cyan" },
    { name: "Moog Synths", icon: <Headphones className="w-6 h-6" />, color: "text-cyber-pink" },
    { name: "Modular Synthesis", icon: <Cpu className="w-6 h-6" />, color: "text-cyber-cyan" },
    { name: "Sound Design", icon: <Palette className="w-6 h-6" />, color: "text-cyber-pink" },
  ];

  const influences = [
    "Tycho", "Boards of Canada", "Aphex Twin", "Brian Eno",
    "Kraftwerk", "Jean-Michel Jarre", "Vangelis", "Tangerine Dream"
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.2,
      },
    },
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 50 },
    visible: {
      opacity: 1,
      y: 0,
      transition: {
        duration: 0.6,
      },
    },
  };

  return (
    <section id="about" className="section-padding bg-cyber-dark">
      <div className="container-custom">
        <motion.div
          ref={ref}
          initial="hidden"
          animate={inView ? "visible" : "hidden"}
          variants={containerVariants}
          className="text-center mb-16"
        >
          <motion.h2
            variants={itemVariants}
            className="text-4xl md:text-6xl font-anton text-cyber-white mb-6 tracking-wider"
          >
            ABOUT
          </motion.h2>
        </motion.div>

        <div className="grid grid-cols-1 lg:grid-cols-2 gap-12 items-center">
          {/* Artist Photo */}
          <motion.div
            variants={containerVariants}
            initial="hidden"
            animate={inView ? "visible" : "hidden"}
            className="relative"
          >
            <motion.div
              variants={itemVariants}
              className="relative w-full aspect-square rounded-lg overflow-hidden border border-cyber-gray"
            >
              <img
                src={process.env.PUBLIC_URL + '/FelixFalken.jpeg'}
                alt="Felix Falken artist photo"
                className="absolute inset-0 w-full h-full object-cover rounded-lg z-0"
                loading="lazy"
              />
              <div className="absolute inset-0 bg-gradient-to-br from-cyber-cyan/20 to-cyber-pink/20 pointer-events-none"></div>
            </motion.div>
          </motion.div>

          {/* Bio Content */}
          <motion.div
            variants={containerVariants}
            initial="hidden"
            animate={inView ? "visible" : "hidden"}
            className="space-y-8"
          >
            <motion.div variants={itemVariants}>
              <h3 className="text-3xl font-bold text-cyber-white mb-6">
                I'm Felix Falken
              </h3>
              <div className="space-y-4 text-cyber-white/80">
                <p>
                  I'm Felix Falken, crafting immersive synth-driven sounds that transport listeners to digital realms. 
                  Music is my language, collaboration is my mission.
                </p>
                <p>
                  With over a decade of experience in electronic music production, I blend analog warmth with digital precision 
                  to create soundscapes that bridge the gap between human emotion and technological innovation.
                </p>
                <p>
                  My work explores themes of futurism, nostalgia, and the intersection of organic and synthetic elements, 
                  creating a unique sonic signature that's both familiar and otherworldly.
                </p>
              </div>
            </motion.div>

            {/* Skills */}
            <motion.div variants={itemVariants}>
              <h4 className="text-xl font-bold text-cyber-white mb-4">
                Tools & Techniques
              </h4>
              <div className="grid grid-cols-2 gap-4">
                {skills.map((skill, index) => (
                  <motion.div
                    key={index}
                    whileHover={{ scale: 1.02 }}
                    className="flex items-center space-x-3 p-3 bg-cyber-gray/30 border border-cyber-gray rounded-lg hover:border-cyber-cyan/50 transition-all duration-300"
                  >
                    <div className={skill.color}>
                      {skill.icon}
                    </div>
                    <span className="text-cyber-white font-medium text-sm">
                      {skill.name}
                    </span>
                  </motion.div>
                ))}
              </div>
            </motion.div>

            {/* Influences */}
            <motion.div variants={itemVariants}>
              <h4 className="text-xl font-bold text-cyber-white mb-4">
                Musical Influences
              </h4>
              <div className="flex flex-wrap gap-2">
                {influences.map((influence, index) => (
                  <span
                    key={index}
                    className="px-3 py-1 bg-cyber-cyan/20 text-cyber-cyan text-xs font-medium rounded-full border border-cyber-cyan/30"
                  >
                    {influence}
                  </span>
                ))}
              </div>
            </motion.div>

            {/* Stats */}
            <motion.div variants={itemVariants} className="grid grid-cols-3 gap-4 pt-4">
              <div className="text-center">
                <div className="text-2xl font-bold text-cyber-cyan">50+</div>
                <div className="text-cyber-white/70 text-sm">Tracks Released</div>
              </div>
              <div className="text-center">
                <div className="text-2xl font-bold text-cyber-pink">10+</div>
                <div className="text-cyber-white/70 text-sm">Years Experience</div>
              </div>
              <div className="text-center">
                <div className="text-2xl font-bold text-cyber-cyan">25+</div>
                <div className="text-cyber-white/70 text-sm">Collaborations</div>
              </div>
            </motion.div>
          </motion.div>
        </div>
      </div>
    </section>
  );
};

export default About;
